    require 'classes/payslip.php';
    $EmployeementNumber = $_SESSION["empid"];
    $databaseNumber = $_SESSION["databaseNumber"];
    $perPost = '202410';
    if (isset($_POST['perpost']) && $_POST['perpost'] != "") {
        $date = new DateTime($_POST['perpost']); 
        $date->modify('+9 month');
        $perPost = $date->format('Ym');
    }
    

    $payslipObject = new Payslip($databaseNumber);
    //getting employee info
    $empInfo = $payslipObject->getEmployeeInfo($EmployeementNumber);
    $employee = 0;

    if ($empInfo) {
        $employee = sqlsrv_fetch_array($empInfo, SQLSRV_FETCH_ASSOC);
            //var_dump($employee );
    }
    //getting bank schedule info
    $EmployBankInfo = $payslipObject->getBankScheduleInfo($EmployeementNumber,$perPost);
    $bankInfo = 0;

    if ($EmployBankInfo) {
        $bankInfo = sqlsrv_fetch_array($EmployBankInfo, SQLSRV_FETCH_ASSOC);

    }
    
    //getting earnings info
    $employEarnings = $payslipObject->getEarnings($EmployeementNumber,$perPost);

    
    //getting deductions info
    $employDeductions = $payslipObject->getDeductions($EmployeementNumber,$perPost);

